    constructor(props) {
        super(props);
        this.deleteNote = this.deleteNote.bind(this)
    }

    deleteNote = async (e) => {
        e.preventDefault();
        console.log("delete ", this);

        /*
                const api_url = await fetch(`http://127.0.0.1:8080/message/1`,
                    {
                        method: 'DELETE', cache: 'no-cache',
                        headers: {'Content-Type': 'application/json'}
                    });

                const data = await api_url.json();
                console.log("after delete" + data);

         */
    };



    render() {

        const Notes = (props) => (
            <ul>
                {props.listOfNotes.map((item, index) => (
                    <li key={index}>
                        {item}
                        <br />
                        <button onClick={() => props.removeItem(index)}>Remove</button>
                    </li>
                ))}
            </ul>
        );

        /*
                        {props.listOfNotes.map((item, index) => (
                            <li key={index}>
                                {item}
                                <br/>
                                <button onClick={() => props.deleteNote()}>Remove</button>
                            </li>
                        ))}

         */

        return (
            <div>
                <Notes deleteNote={this.deleteNote} listOfNotes={this.notes}/>
            </div>
        );
    }
}

export default Results;
